import React, { Component, useState } from "react";
import Particles from "react-particles-js";
import { useTrail, animated } from "react-spring";

const particleParams = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      }
    },
    color: {
      value: "#c65039"
    },
    line_linked: {
      enable: false,
      color: "#c65039",
      opacity: 0.95,
      width: 3
    }
  },
  interactivity: {
    detect_on: "canvas",
    events: {
      onhover: {
        enable: true,
        mode: "repulse"
      },
      onclick: {
        enable: true,
        mode: "push"
      }
    },
    modes: {
      grab: {
        distance: 400,
        line_linked: {
          opacity: 1
        }
      },
      repulse: {
        distance: 50,
        duration: 0.4
      },
      push: {
        particles_nb: 4
      }
    }
  }
};

class Homepage extends Component {
  render() {
    return (
      //<div className="container">
      <div className="particles">
        <Particles params={particleParams}>
          <h1>Hi! My name is Travis!</h1>
        </Particles>
      </div>
      //</div>
    );
  }
}

export default Homepage;
